import Link from "next/link";

const BlockLink = (props) => (
  <Link href={`/${props.link}`} as={`/cudzoziemcy/${props.link}`}>
    <a>
      <div className="block-option">
        <h2>{props.title}</h2>
      </div>
    </a>
  </Link>
);

const MenuBlock = ({ title, link }) => {
  return (
    <Link href={`/${props.link}`} as={`/cudzoziemcy/${props.link}`}>
      <a>
        <div className="block-option">
          <h2>{props.title}</h2>
        </div>
      </a>
    </Link>
  );
};

export default MenuBlock;
